import React from "react";
import PropTypes from "prop-types";
import styled from "styled-components";

const Id = styled.h1``;
const h1 = styled.h1``;

const ExercisePresenter = id => {
  ExercisePresenter.propTypes = {
    id: PropTypes.number
  };
  return (
    <Id>
      <h1>test</h1>
    </Id>
  );
};

export default ExercisePresenter;
